import React from 'react';

import { Routes, Route, Link } from "react-router-dom";
import Hangman from './Hangman';
import './App.css'

const App = () => (
  <>
    <div class="navbar">

      <Link to="/hangman">Hangman</Link>
    </div>
    <div class="container">
      <Routes>
        <Route path="/hangman" element={<Hangman />} />
      </Routes>
    </div>
  </>





)

export default App;
